import { Link } from "react-router-dom";
import "../App.css";

function SignupForm(){
    return (
        <div>
            <h1>Sign Up</h1> <hr/>

            <form action="@{/user}" method="POST">
                ID : <input type="text" name="id"/> <br/>
                PW : <input type="password" name="password"/> <br/>
                <input type="radio" name="auth" value="ROLE_ADMIN, ROLE_USER"/> ADMIN
                <input type="radio" name="auth" value="ROLE_USER" checked="checked"/> USER <br/>
                <button type="submit" id="btn-post">Join</button>
            </form>

            <Link id="none" to="/"><button id="btn-default">Go to Login â†’</button></Link>
        </div>
    )
}

export default SignupForm;
